import Maps from "../components/Maps";

const HomePage = (props) => {
  return (
    <>
      <h1>Home</h1>
      <div className="container">
        <div className="row">
          <div className="col-6">
            <Maps location={[10.33, 45.432]} />
          </div>
        </div>
      </div>
    </>
  );
};

export default HomePage;
